import { Link } from 'react-router-dom';

class Comment extends Component {
    render() {
        
        const { talkId, userId, comments } = this.props;
        return (
            <div>
                <ul>
                    <p>{comments}</p> <br/>
                </ul>
            </div>
        );
    }
}

export default Comment;
